import MenuIcon from '../../assets/images/icon-menu.svg';
import HomeIcon from '../../assets/images/icon-home.svg';
import SearchIcon from '../../assets/images/icon-search.svg';

import './AppHeader.scss';

export const AppHeader = () => {
    return (
        <div className="navbar">
            <div className="left">
                <div className="btn__sidebar-collapse center btn btn-primary">
                    <svg viewBox="0 0 24 24" class="close_icon" width="24" height="24"><path fill="currentColor" fill-rule="nonzero" d="M5.146 5.146a.5.5 0 0 1 .708 0L12 11.293l6.146-6.147a.5.5 0 0 1 .638-.057l.07.057a.5.5 0 0 1 0 .708L12.707 12l6.147 6.146a.5.5 0 0 1 .057.638l-.057.07a.5.5 0 0 1-.708 0L12 12.707l-6.146 6.147a.5.5 0 0 1-.638.057l-.07-.057a.5.5 0 0 1 0-.708L11.293 12 5.146 5.854a.5.5 0 0 1-.057-.638z"></path></svg>
                </div>
                <div className="navbar__home center btn btn-primary">
                    <img src={HomeIcon} alt="home icon" />
                </div>
                <div className="navbar__search-field center btn btn-primary">
                    <img src={SearchIcon} alt="search icon" />
                    <input type="text" placeholder='Search' />
                </div>
            </div>
            <div className="right">
                <div className="user"></div>
            </div>
        </div>
    );
}
